  };

return(
  <Card>
    <li className={classes.card2}>
      <h2>{props.name}</h2>
      <h3>{props.username}</h3>
      <p>{props.email}</p>
      <button onClick={deletePeople} className={classes.card3}>Delete</button>
      </li>
    </Card>
);
};
